<div class="entities" style="line-height: 2.5; direction: ltr">Human parainfluenza virus-associated respiratory tract infection among children and genetic analysis of HPIV - 3 strains in Beijing , China . The relevance of human parainfluenza viruses ( HPIVs ) to the epidemiology of acute respiratory infections ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q9Y4X5
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) in China is unclear . From May 2008 to September 2010 , 443 nasopharyngeal aspirates ( NPAs ) from hospitalized pediatric patients ( age from 1 to 93 months ) in Beijing were collected and screened for HPIVs and other common respiratory viruses by real-time RT-PCR . Sixty-two of 443 samples were positive for HPIVs with 4 positive for HPIV - 2 and 58 positive for HPIV - 3 , indicating that HPIV - 3 was the predominant virus present during the study period . A phylogenetic tree based on all the available HN ( hemagglutinin-neuraminidase ) sequences of HPIV - 3 indicated that three distinct clusters ( A , B , and C ) were circulating with some temporal and regional clustering . Cluster C was further divided into sub-clusters , C1 , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P06681
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01024
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and C4 . HPIV - 3 from Beijing isolates belonged to sub-cluster 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01024
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , and were grouped with the isolates from two Provinces of China and the neighboring country of Japan . Genetic analysis based on entire HN gene revealed that the HPIV - 3 isolates from Beijing were highly similar with 97.2 % - 100 % identity at the nucleotide level and these could be divided into two closely related lineages , C3a and C3b . These findings suggested that there was co-circulation of multiple lineages of HPIV - 3 in the Beijing region during the study period . This is the first study to describe the epidemiology and molecular characterization of HPIVs in China .</div>

 for vitreoretinal diseases .

 and laminin are clinically relevant plasmin receptors in the eye . Located at the vitreoretinal interface , they are cleaved by ocriplasmin ( DB05028 , ThromboGenics , Iselin , NJ ) , a novel ophthalmic medication . A series of clinical trials to study ocriplasmin for the treatment of vitreoretinal diseases such as vitreomacular traction , macular hole , and exudative age-related macular degeneration are underway . The results are promising and may impact patient care .</div>

 (

 ) : a new oral multikinase inhibitor of angiogenic , stromal and oncogenic receptor tyrosine kinases with potent preclinical antitumor activity . Angiogenesis , a critical driver of tumor development , is controlled by interconnected signaling pathways . Vascular endothelial growth factor receptor ( VEGFR ) 2 and tyrosine kinase with immunoglobulin and epidermal growth factor homology domain 2 play crucial roles in the biology of normal and tumor vasculature . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 (

 ) , a novel oral multikinase inhibitor , potently inhibits these endothelial cell kinases in biochemical and cellular kinase phosphorylation assays . Furthermore , regorafenib inhibits additional angiogenic kinases (

 / 3 , platelet-derived growth factor receptor- and fibroblast growth factor receptor 1 ) and the mutant oncogenic kinases

    P10721

 , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 and B-RAF . The antiangiogenic effect of regorafenib was demonstrated in vivo by dynamic contrast-enhanced magnetic resonance imaging . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 administered once orally at 10 mg / kg significantly decreased the extravasation of Gadomer in the vasculature of rat GS9L glioblastoma tumor xenografts . In a daily ( qd )  4 dosing study , the pharmacodynamic effects persisted for 48 hr after the last dosing and correlated with tumor growth inhibition ( TGI ) . A significant reduction in tumor microvessel area was observed in a human colorectal xenograft after qd  5 dosing at 10 and 30 mg / kg . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 exhibited potent dose-dependent TGI in various preclinical human xenograft models in mice , with tumor shrinkages observed in breast MDA-MB - 231 and renal 786 - O carcinoma models . Pharmacodynamic analyses of the breast model revealed strong reduction in staining of proliferation marker Ki - 67 and phosphorylated extracellular regulated kinases 1/2 . These data demonstrate that regorafenib is a well-tolerated , orally active multikinase inhibitor with a distinct target profile that may have therapeutic benefit in human malignancies .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">CXC chemokine receptor 4 is a cell surface receptor for extracellular ubiquitin . Ubiquitin is one of the most highly conserved proteins in eukaryotes and plays major biological roles as a post-translational protein modifier . Ubiquitin is also a natural constituent of plasma , and several lines of evidence suggest that extracellular ubiquitin is an immune modulator with anti-inflammatory properties . In addition , ubiquitin treatment has been shown to limit inflammation and reduce organ injury in various disease models and species in vivo . However , its mechanism of action is unknown . Here we show that extracellular ubiquitin is a natural CXC chemokine receptor 4 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 and CD184 ) agonist . Extracellular ubiquitin promotes intracellular Ca ( 2 + ) flux and reduces DB02527 levels through a G protein-coupled receptor that signals via a Galpha ( i / o ) protein in THP 1 cells .

 stimulation reduces ubiquitin-binding sites , which enabled identification of four Galpha ( i / o ) PCRs as ubiquitin receptor candidates . Overexpression of candidate genes in HEK 293 cells , gene silencing in THP 1 cells , competition binding , and signaling studies with the

 was the first DB00644 antagonist to be developed and was approved by the USA Food and Drug Administration in 2004 for the initiation of hormonal castration in advanced or metastasizing hormone-dependent prostate carcinoma , when rapid androgen suppression is necessary . Clinical data on both abarelix and degarelix show that they can produce rapid and sustained decreases in testosterone to castrate levels without the need for co-administration of an antiandrogen , and with a very low complication rate in the short term .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Effect of currently approved carriers and adjuvants on the pre-clinical efficacy of a conjugate vaccine against oxycodone in mice and rats . Vaccination against the highly abused prescription opioid oxycodone has shown pre-clinical efficacy for blocking oxycodone effects . The current study further evaluated a candidate vaccine composed of oxycodone derivatized at the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13671
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 position ( 6OXY ) conjugated to the native DB05299 ( nKLH ) carrier protein . To provide an oxycodone vaccine formulation suitable for human studies , we studied the effect of alternative carriers and adjuvants on the generation of oxycodone-specific serum antibody and B cell responses , and the effect of immunization on oxycodone distribution and oxycodone-induced antinociception in mice and rats . 6OXY conjugated to tetanus toxoid ( TT ) or a GMP grade KLH dimer ( dKLH ) was as effective as 6OXY conjugated to the nKLH decamer in mice and rats , while the 6OXY hapten conjugated to a TT-derived peptide was not effective in preventing oxycodone-induced antinociception in mice . Immunization with 6OXY - TT s . c . absorbed on alum adjuvant provided similar protection to 6OXY - TT administered i . p . with Freund ' s adjuvant in rats . The toll-like receptor 4 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    O00206
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) agonist monophosphoryl lipid A ( MPLA ) adjuvant , alone or in combination with alum , offered no advantage over alum alone for generating oxycodone-specific serum antibodies or 6OXY - specific antibody secreting B cells in mice vaccinated with 6OXY - nKLH or 6OXY - TT . The immunogenicity of oxycodone vaccines may be modulated by 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 signaling since responses to 6OXY - nKLH in alum were decreased in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 - deficient mice . These data suggest that TT , nKLH and dKLH carriers provide consistent 6OXY conjugate vaccine immunogenicity across species , strains and via different routes of administration , while adjuvant formulations may need to be tailored to individual immunogens or patient populations .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">NFB inhibitors induce cell death in glioblastomas . Identification of novel target pathways in glioblastoma ( GBM ) remains critical due to poor prognosis , inefficient therapies and recurrence associated with these tumors . In this work , we evaluated the role of nuclear-factor-kappa-B ( NFB ) in the growth of GBM cells , and the potential of NFB inhibitors as antiglioma agents . NFB pathway was found overstimulated in GBM cell lines and in tumor specimens compared to normal astrocytes and healthy brain tissues , respectively . Treatment of a panel of established GBM cell lines ( U138MG , U87 , U373 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13671
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) with pharmacological NFB inhibitors ( BAY 117082 , parthenolide , MG132 , curcumin and arsenic trioxide ) and NFB-p 65 siRNA markedly decreased the viability of GBMs as compared to inhibitors of other signaling pathways such as MAPKs ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29323
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , JNK and p38 ) , PKC , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00533
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and PI3K / Akt . In addition , NFB inhibitors presented a low toxicity to normal astrocytes , indicating selectivity to cancerous cells . In GBMs , mitochondrial dysfunction ( membrane depolarization , bcl-xL downregulation and cytochrome c release ) and arrest in the G2 / M phase were observed at the early steps of NFB inhibitors treatment . These events preceded sub - P55008 detection , apoptotic body formation and caspase - 3 activation . Also , NFB was found overstimulated in cisplatin-resistant 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 cells , and treatment of GBMs with NFB inhibitors overcame cisplatin resistance besides potentiating the effects of the chemotherapeutics , cisplatin and doxorubicin . These findings support NFB as a potential target to cell death induction in GBMs , and that the NFB inhibitors may be considered for in vivo testing on animal models and possibly on GBM therapy .</div>
